@Component({
  selector: 'testing',
  templateUrl: './test.component.html',
  styleUrls: ['./test.component.css']
})
export class TestComponent {
  public name = "Fabian";
  public favoriteQuote = "The lyf so short, the craft so long to learne ~George Chaucer";
  public someJson = {
    name: "philip",
    surname:"Gumbi",
    located: "Naturena"
  }
}
<div>
  <h1>{{name | uppercase }}</h1>
  <h1>{{name | lowercase }}</h1>
  <h1>{{name | titlecase }}</h1>
  <h1>{{name | slice:4:6 }}</h1>
  <h1>{{someJson | json }}</h1>
</div>
